import { Box, Typography, useTheme, useMediaQuery } from "@mui/material";

const LoginPage = () => {
    const theme = useTheme();
    const isNonMobileScreens = useMediaQuery("(min-width: 1000px)");

    return (
        <Box>
            <Box width="100%" backgroundColor={theme.palette.background.alt} p="1rem 6%" text>
                <Typography
                    fontWeight="bold"
                    fontSize="32px"
                    color="primary"
                >
                    Afrobook
                </Typography>
            </Box>
        </Box>
    )
};

export default LoginPage;
